import React from 'react';
import books from './books.jpg';
import '../Fonts/The Blacklist.ttf';
import './showcase.css';

const Showcase = () => {
	return (
		<div className='showcase'>
			<div className='logo'>
				<h1>Better Bindings</h1>
			</div>
		</div>
	)
}

export default Showcase;
